local function SerializeTable(val, s, depth, key)
    depth = depth or 1
    if depth == 1 then
        s = {}
    end

    if key then
        s[#s + 1] = key
        s[#s + 1] = "="
    end

    if type(val) == "table" then
        s[#s + 1] = "{"
        -- Simple array detection
        if val[1] then
            for i = 1, #val do
                SerializeTable(val[i], s, depth + 1)
                if i < #val then
                    s[#s + 1] = ","
                end
                if i % 5000 == 0 then
                    Task.Wait()
                end
            end
        else
            local iterCount = 0
            for k, v in pairs(val) do
                SerializeTable(v, s, depth + 1, k)
                s[#s + 1] = ","
                iterCount = iterCount + 1
                if iterCount % 5000 == 0 then
                    Task.Wait()
                end
            end
            if iterCount > 0 then
                s[#s] = ""
            end
        end
        s[#s + 1] = "}"
    elseif type(val) == "number" then
        local floor = math.floor
        local valFloor = floor(val)
        local dec = val > valFloor
        if dec then
            s[#s + 1] = tostring(val)
        else
            s[#s + 1] = tostring(valFloor)
        end
    elseif type(val) == "string" then
        local format = string.format
        s[#s + 1] = format("%q", val)
    elseif type(val) == "boolean" then
        s[#s + 1] = (val and "true" or "false")
    else
        error("inserializeable datatype \"" .. type(val) .. "\"")
    end

    if depth == 1 then
        return table.concat(s)
    end
end

